# https://leetcode.com/problems/as-far-from-land-as-possible/

defmodule Solution do
  @no_land_or_water_res -1
  @land_val 1
  @water_val 0

  @spec max_distance(grid :: [[integer]]) :: integer
  def max_distance(grid) do
    for {row, r} <- Enum.with_index(grid, 1) do
      for {val, c} <- Enum.with_index(row, 1) do
        {{r, c}, val}
      end
    end
    |> List.flatten()
    |> Enum.into(%{})
    |> do_find_max_distance(0)
    |> case do
      0 -> @no_land_or_water_res
      res -> res
    end
  end

  defp do_find_max_distance(grid_map, distance) do
    new_lands = grid_map
    |> Enum.filter(fn {_, val} -> val == @land_val end)
    |> Enum.reduce(%{}, fn {pos, _}, new_land ->
      get_neighbours(pos)
      |> Enum.filter(fn pos -> Map.get(grid_map, pos) == @water_val end)
      |> Enum.map(fn pos -> {pos, @land_val} end)
      |> Enum.into(%{})
      |> Map.merge(new_land)
    end)

    cond do
      map_size(new_lands) == 0 -> distance
      true ->
        new_map = Map.merge(grid_map, new_lands)
        do_find_max_distance(new_map, distance + 1)
    end
  end

  defp get_neighbours({r, c}) do
    [[1, 0], [0, 1], [-1, 0], [0, -1]]
    |> Enum.map(fn [rd, cd] -> {r + rd, c + cd} end)
  end
end

-1 = Solution.max_distance([[1]])
-1 = Solution.max_distance([[0]])
2 = Solution.max_distance([[0, 1], [0, 0]])
2 = Solution.max_distance([[1, 0, 1], [0, 0, 0], [1, 0, 1]])
4 = Solution.max_distance([[1, 0, 0], [0, 0, 0], [0, 0, 0]])
